import{_ as e,o as t,c as o,O as n}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 6.2-1316 Offenses; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-1316.md","filePath":"vacode/6.2-1316.md"}'),r={name:"vacode/6.2-1316.md"},a=n('<h1 id="§-6-2-1316-offenses-penalty" tabindex="-1">§ 6.2-1316 Offenses; penalty. <a class="header-anchor" href="#§-6-2-1316-offenses-penalty" aria-label="Permalink to &quot;§ 6.2-1316 Offenses; penalty.&quot;">​</a></h1><p>Any officer, director, employee, receiver, or agent of a credit union who willfully does any of the following is guilty of a Class 6 felony:</p><ol><li><p>With the intent to deceive, falsifies any book of account, report, statement, record, or other document of a credit union, whether by alteration, false entry, omission, or otherwise;</p></li><li><p>Signs, issues, publishes, or transmits to a government agency any book of account, report, statement, record, or other document that he knows to be false;</p></li><li><p>By means of deceit, obtains a signature to a writing that is a subject of forgery;</p></li><li><p>With intent to deceive, destroys any credit union book of account, report, statement, record, or other document; or</p></li><li><p>With the intent to defraud, shares or receives directly or indirectly any money, property, or benefits through any transaction of the credit union.</p></li></ol><p>1985, c. 363, § 6.1-223.2; 1990, c. 373, § 6.1-225.62; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',4),i=[a];function s(c,l,f,d,p,h){return t(),o("div",null,i)}const y=e(r,[["render",s]]);export{u as __pageData,y as default};
